
const icon = 'data:image/png;base64,';



function clickById(idname) {
    if (id(idname).exists()) return id(idname).click();
}

function clickByText(text) {
    if (text(text).exists()) return text(text).click();

}

function clickByDesc(desc) {
    if (desc(desc).exists()) return desc(desc).click();
}



module.exports = function (run_call, stop_call) {
    if (console._floaty) console._floaty.close();
    if (console._my_interval) {
        ui.run(function(){
            clearInterval(console._my_interval)
        })
    }
    if (console._script_thread) {
        try {
            if (console._script_thread.isAlive()) console._script_thread.interrupt()
        } catch (err) {
            console.error(err)
        }
    }
    console._floaty = floaty.window(
        <frame>
            <img src={icon} id='action' circle='true' w='60dp' h='60dp'></img>
        </frame>
    );

    console._floaty.setPosition(0, Math.floor(device.height * 0.5))
    let runState = false
    let x = 0, y = 0, rota = 0
    let windowX, windowY, downTime
    console._script_thread = threads.start(function(){console.log('new thread runed.')})
    console._floaty.action.setOnTouchListener(function(view, event){
        switch(event.getAction()) {
            case event.ACTION_DOWN:
                x = event.getRawX();
                y = event.getRawY();
                windowX = console._floaty.getX();
                windowY = console._floaty.getY();
                downTime = new Date().getTime();
                return true;
            case event.ACTION_MOVE:
                console._floaty.setPosition(windowX + (event.getRawX() - x), windowY + (event.getRawY() - y));
                return true;
            case event.ACTION_UP:
                if(Math.abs(event.getRawY() - y) < 5 && Math.abs(event.getRawX() - x) < 5) {
                    runState = !runState

                    if (console._my_interval) {
                        ui.run(function(){
                            clearInterval(console._my_interval)
                        })
                    }
                    // if (stop_call) stop_call()
                    if (console._script_thread) {
                        try {
                            if (console._script_thread.isAlive()) console._script_thread.interrupt()
                        } catch (err) {
                            console.error(err)
                        }
                    }

                    if (runState) {
                        console._my_interval = setInterval(function() {
                            rota++
                            console._floaty.action.setRotation(rota)
                            // if (rota % 20 == 0) {
                            //     clickById('popClose')
                            //     clickById('iv_close')
                            // }
                        }, 10)
                        if (run_call) {
                            console._script_thread = threads.start(function(){
                                run_call()
                                console.log('执行结束')
                                ui.run(function(){
                                    runState = false
                                    clearInterval(console._my_interval)
                                })
                            })
                        }
                    } else {
                        if (stop_call) stop_call()
                    }
                }
                return true;
        }
        return true;
    });
}
